import { FaTimes } from 'react-icons/fa'

const Task = ({ key, task }) => {
  return (
    <div className="task" key={key}>
      <h3>
        {task.text} <FaTimes style={{ cursor: 'pointer' }} />
      </h3>
      <p>{task.day}</p>
    </div>
  )
}

export default Task
